import React from "react";
import './Main_Heading_Signup.css'

const Main_Heading_Signup=()=>{
    return(
        <div className="Main_Heading_Signup_Heading_Box">
            <p>
                <text className="Main_Heading_Signup_Heading">Register your account now.</text>
                <br></br>
                <text className="Main_Heading_Signup_Sub_Heading">Sign up now to get started and stay connected.</text>
            </p>
        </div>
    )
}

export default Main_Heading_Signup;
